class UserInfo {  int? status;  String? message;  Data? data;  UserInfo({this.status, this.message, this.data});  UserInfo.fromJson(Map<String, dynamic> json) {    status = json['status'];    message = json['message'];    data = json['data'] != null ? new Data.fromJson(json['data']) : null;  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['status'] = this.status;    data['message'] = this.message;    if (this.data != null) {      data['data'] = this.data!.toJson();    }    return data;  }}class Data {  String? name;  String? email;  String? phone;  String? photo;  String? sex;  String? age;  String? weight;  String? token;  Data(      {this.name,      this.email,      this.phone,      this.photo,      this.sex,      this.age,      this.weight,      this.token});  Data.fromJson(Map<String, dynamic> json) {    name = json['name'];    email = json['email'];    phone = json['phone'];    photo = json['photo'];    sex = json['sex'];    age = json['age'];    weight = json['weight'];    token = json['token'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['name'] = this.name;    data['email'] = this.email;    data['phone'] = this.phone;    data['photo'] = this.photo;    data['sex'] = this.sex;    data['age'] = this.age;    data['weight'] = this.weight;    data['token'] = this.token;    return data;  }}